import React from 'react';

import MainRoutes from './Routes'
import Sidebar from './components/Sidebar'


import './styles.css'
import Dashboard from './components/Dashboard';

function App() {
  return (
    <div className="app">
     
     {/** Sidebar */}
     <Dashboard/>

     {/** Inner container */}
    <MainRoutes/>
    </div>
  );
}

export default App;
